import SignUp2_background from "./img/SignUp2_background.png";

const SignUp2 = () => {
    return (
        <div className="SignUp2">
            <div className="signup2_background_img">
                <img src={SignUp2_background}></img>
            </div>
        </div>
    );
};

export default SignUp2;
